import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const FeedbackDetails = () => {
  const { id } = useParams();
  const [feedback, setFeedback] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchFeedbackDetails = async () => {
      try {
        const response = await fetch(`http://localhost:3000/feedback/${id}`);
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        console.log('Received feedback details:', data); // Log received data for debugging
        setFeedback(data);
        setError(null); // Reset error state if fetch is successful
      } catch (error) {
        console.error('Error fetching feedback details:', error);
        setError(error.message); // Set error state with the error message
      }
    };

    fetchFeedbackDetails();
  }, [id]);

  if (error) {
    return <p>Error fetching feedback details: {error}</p>;
  }

  if (!feedback) {
    return <p>Loading...</p>; // Add loading state if needed
  }

  return (
    <div className="bg-gray-100 min-h-screen p-6">
      <h2 className="text-2xl font-bold mb-4 text-center">Feedback Details</h2>
      <div className="bg-white shadow-lg rounded-lg p-6">
        <div className="grid grid-cols-1 gap-4">
          <div className="flex flex-col items-center mb-4">
            <h3 className="text-xl font-bold mb-2 text-center">Aspect</h3>
            <p className="text-center">{feedback.aspect}</p>
          </div>

          <div className="flex flex-col items-center mb-4">
            <h3 className="text-xl font-bold mb-2 text-center">Satisfaction Level</h3>
            <p className="text-center">{feedback.satisfaction_level}</p>
          </div>

          <div className="flex flex-col items-center mb-4">
            <h3 className="text-xl font-bold mb-2 text-center">Improvement Suggestions</h3>
            <p className="text-center">{feedback.improvement_suggestions}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FeedbackDetails;
